// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import Banner from './components/Banner';
import CourseCard from './components/CourseCard';

const courseData = [
  { title: "AWS", image: "https://example.com/aws-image.jpg" },
  { title: "Supabase with Next.js", image: "https://example.com/supabase-nextjs-image.jpg" },
  { title: "Business PM", image: "https://example.com/business-pm-image.jpg" },
  { title: "CS", image: "https://example.com/cs-image.jpg" }
];

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<Banner />} />
          <Route path="/courses" element={
            <div className="course-list">
              {courseData.map(course => (
                <CourseCard key={course.title} title={course.title} image={course.image} />
              ))}
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
